import styles from './App.module.css';
import useGames from "./hooks/useGames.js";
import { useEffect, useState } from "react";
import imdb from "./assets/imdb.png";
import SearchBar from "./components/SearchBar.jsx";
import Home from "./pages/Home.jsx";
import GameDetail from "./pages/GameDetail.jsx";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import tiktok from "./assets/tiktok.png";
import instagram from "./assets/instagram.png";
import twitter from "./assets/twitter.png";
import youtube from "./assets/youtube.png";
import facebook from "./assets/facebook.png";

function App() {
	const [search, setSearch] = useState("");
	useEffect(() => {
		document.title = "IMDb Top 60 Video Games Ezra";
	});
  return (
	  <>
	  <div className={styles.all}>
	  <div className={styles.navigation}>
	  <SearchBar search={search} setSearch={setSearch}/> 		{console.log(search)}
	  </div>
	  <div className={styles.main}>
	  <Router>
	  <Routes>
	  	<Route index element={<Home search={search}/>} />
	  	<Route path="/:id" element={<GameDetail />} />
	  </Routes>
	  </Router>
	  </div>
	  <div className={styles.side}><span className={styles.yellowbox}></span>More to explore</div>
	  <div></div>
	  <div className={styles.blackbottom}> 
	  <div className={styles.blacktitle}>Recently viewed</div>
	  <p className={styles.blackcontent}>You have no recently viewed pages</p>
	  <img src={tiktok} className={styles.blackicons}/>
	  <img src={instagram} className={styles.blackicons}/>
	  <img src={twitter} className={styles.blackicons}/>
	  <img src={youtube} className={styles.blackicons}/>
	  <img src={facebook} className={styles.blackicons}/>
	  </div>
	  </div>
	  </>
  );
}

export default App;
